const BASE_URL = "https://server.intensivecode.se/api/foods";

const CREDENTIALS = "?username=aladin&accessCode=LiElOz";

export function getFoods() {
  return axios.get<Food[]>(`${BASE_URL}${CREDENTIALS}`);
}

export function getFood(id: string) {
  return axios.get<Food>(
    ` https://server.intensivecode.se/api/foods/${id}?username=aladin&accessCode=LiElOz`
  );
}

export function saveFood(food: FoodFormData) {
  const categoryInDb = getCategories().find(
    (category) => category.id === food.categoryId
  );

  if (!categoryInDb) throw new Error(`Category was not found`);

  const foodInDb = foods.find((f) => f.id === food.id) || ({} as Food);

  foodInDb.name = food.name;
  foodInDb.category = categoryInDb;
  foodInDb.numberInStock = food.numberInStock;
  foodInDb.price = food.price;

  if (!foodInDb.id) {
    foodInDb.id = Date.now().toString();
    foods.push(foodInDb);
  }

  return foodInDb;
}

export function deleteFood(id: string) {
  const foodInDb = foods.find((food) => food.id === id);

  if (foodInDb) foods.splice(foods.indexOf(foodInDb), 1);

  return foodInDb;
}
